      SELECT - + CAST ( + - col0 AS INTEGER ) / - ( - + col0 ) + col1 + ( + col2 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT BETWEEN + col2 + 68 AND col2;
  - name: tab1

outputs:
  - name: q8926.out
    data: |
